import React from 'react'


const Hello = (props) => {
  return (
    <div>
      <p>Hello {props.name}, you are {props.age} years old</p>    </div>
  )
}

const Footer = () => {
  return (
    <div>
      greeting app created by <a href="https://github.com/mluukkai">mluukkai</a>
    </div>
  )
}

const App = () => {
  const name = "Fatin";
  const age = 28;
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="Maya" age={13}/>
      <Hello name={name} age={age} />
    </div>
  )
}

export default App  //defines a react component with name App.

